    [Benchmark]
    public void SerialBubbleSort()
    {
        List<string> wordsForSerialSort = new List<string>(words);
        SerialBubbleSortMethod(wordsForSerialSort);
    }

    [Benchmark]
    public void ParallelBubbleSort()
    {
        List<string> wordsForParallelSort = new List<string>(words);
        ParallelBubbleSortMethod(wordsForParallelSort);
    }

    public static void SerialBubbleSortMethod(List<string> words)
    {
        int n = words.Count;
        bool swapped;

        for (int i = 0; i < n - 1; i++)
        {
            swapped = false;

            for (int j = 0; j < n - i - 1; j++)
            {
                if (string.Compare(words[j], words[j + 1], StringComparison.OrdinalIgnoreCase) > 0)
                {
                    string temp = words[j];
                    words[j] = words[j + 1];
                    words[j + 1] = temp;
                    swapped = true;
                }
            }

            if (!swapped)
                break;
        }
    }

    private const int ThreadCount = 16;

    public static void ParallelBubbleSortMethod(List<string> words)
    {
        int n = words.Count;
        int chunkSize = (n + ThreadCount - 1) / ThreadCount;

        Thread[] threads = new Thread[ThreadCount];
        List<List<string>> chunks = new List<List<string>>();

        // Divide the list into chunks for each thread
        for (int i = 0; i < ThreadCount; i++)
        {
            int start = i * chunkSize;
            int end = Math.Min(start + chunkSize, n);
            List<string> chunk = words.GetRange(start, end - start);
            chunks.Add(chunk);
        }

        // Sort each chunk in parallel
        for (int i = 0; i < ThreadCount; i++)
        {
            int index = i;
            threads[i] = new Thread(() => SerialBubbleSortMethod(chunks[index]));
            threads[i].Start();
        }

        // Wait for all threads to finish sorting
        foreach (Thread thread in threads)
        {
            thread.Join();
        }

        // Merge the sorted chunks sequentially
        List<string> sortedWords = MergeChunks(chunks);
        words.Clear();
        words.AddRange(sortedWords);
    }

    private static List<string> MergeChunks(List<List<string>> chunks)
        {
            List<string> merged = chunks[0];

            for (int i = 1; i < chunks.Count; i++)
            {
                merged = MergeTwoLists(merged, chunks[i]);
            }

            return merged;
        }

    private static List<string> MergeTwoLists(List<string> list1, List<string> list2)
    {
        List<string> result = new List<string>();
        int i = 0, j = 0;

        while (i < list1.Count && j < list2.Count)
        {
            if (string.Compare(list1[i], list2[j], StringComparison.OrdinalIgnoreCase) <= 0)
            {
                result.Add(list1[i]);
                i++;
            }
            else
            {
                result.Add(list2[j]);
                j++;
            }
        }

        result.AddRange(list1.GetRange(i, list1.Count - i));
        result.AddRange(list2.GetRange(j, list2.Count - j));

        return result;
    }
